import React from 'react'

export const LoginPage = () => {
  return (
    <div className="login">
      <div className="login__header">
        <h2 className="j-title">Login</h2>
        <img src="../assets/logo.svg" alt="Journal-logo" />
      </div>
    </div>
  )
}
